class SitterJob extends Component {

    
    render() {
        const[ id, title ] = this.props;
        return (
            <div>
                <ul>
                    <a href=""><li key={id}>{title}</li> </a> 
                </ul>
            </div>
        );
    }
}

export default SitterJob;
